    l = list(s)
    f = sorted(l)
    if l != f:
        return 'YES'
    for i in range(n):
        if l[i] > l[n - 1 - i]:
            (l[i], l[n - 1 - i]) = (l[n - 1 - i], l[i])
        if l == f:
            return 'YES'
    return 'NO'

